import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 50-73.70 Payment of fees, fines, penalties, and interest prerequisite to Commission action; refunds.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.70.md","filePath":"vacode/50-73.70.md"}'),n={name:"vacode/50-73.70.md"},r=a('<h1 id="§-50-73-70-payment-of-fees-fines-penalties-and-interest-prerequisite-to-commission-action-refunds" tabindex="-1">§ 50-73.70 Payment of fees, fines, penalties, and interest prerequisite to Commission action; refunds. <a class="header-anchor" href="#§-50-73-70-payment-of-fees-fines-penalties-and-interest-prerequisite-to-commission-action-refunds" aria-label="Permalink to &quot;§ 50-73.70 Payment of fees, fines, penalties, and interest prerequisite to Commission action; refunds.&quot;">​</a></h1><p>A. The Commission shall not file or issue with respect to any domestic or foreign limited partnership any document or certificate specified in this chapter, except a statement of change pursuant to § <a href="/vacode/50-73.5/">50-73.5</a> and a statement of resignation pursuant to § <a href="/vacode/50-73.6/">50-73.6</a>, until all fees, fines, penalties, and interest assessed, imposed, charged, or to be collected by the Commission pursuant to this chapter or Title 12.1 have been paid by or on behalf of such limited partnership. Notwithstanding the foregoing, the Commission may file or issue any document or certificate with respect to a domestic or foreign limited partnership that has been assessed an annual registration fee if the document or certificate is filed or issued with an effective date that is on or before the due date of the limited partnership&#39;s annual registration fee payment in any year, provided that the Commission shall not issue a certificate of conversion with respect to a domestic limited partnership that will become a domestic stock corporation until the annual registration fee has been paid by or on behalf of the limited partnership.</p><p>B. The Commission shall have authority to certify to the Comptroller directing refund of any overpayment of a fee, or of any fee collected for a document that is not accepted for filing, at any time within one year from the date of its payment.</p><p>1985, c. 607; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0441" target="_blank" rel="noreferrer">441</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0316" target="_blank" rel="noreferrer">316</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0659" target="_blank" rel="noreferrer">659</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0810" target="_blank" rel="noreferrer">810</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0487" target="_blank" rel="noreferrer">487</a>.</p>',4),o=[r];function s(f,c,l,p,h,d){return t(),i("div",null,o)}const g=e(n,[["render",s]]);export{u as __pageData,g as default};
